import {
    Select,
    MenuItem,
    FormControl,
    InputLabel
} from '@mui/material';
import { useState } from 'react';

const OrderPage = ({ dataList }) => {

    return (
        <FormControl fullWidth>
            <InputLabel id="item-label">Item</InputLabel>
            <Select
                labelId="item-label"
                label="Item"
            >
                {dataList?.map((item) => (
                    <MenuItem key={item.id} value={item.inventoryName}>
                        {item.inventoryName}
                    </MenuItem>
                ))}
            </Select>
        </FormControl>
    );
};

export default OrderPage;
